// import React, { Component } from "react";
import React from "react";
import "./style.css";
import API from "../utils/API"

function Card(props) {

    API.search()
    .then(res => this.setState({ result: res.data }))
      .catch(err => console.log(err));

    return (
        <div className="card">
            <img alt={`picture of animal crossing character${props.name}`} src={props.url}/>
            <h3>{props.name}</h3>
            <p></p>
        </div>
    )
}

export default Card;
